import React from 'react';
import 'react-vis/dist/style.css';
import { SingletonSocket } from '../SingletonSocket';
import {
	XYPlot,
	XAxis,
	YAxis,
	VerticalGridLines,
	HorizontalGridLines,
	VerticalBarSeries,
	VerticalBarSeriesCanvas,
	LabelSeries,
	LineSeries,
} from 'react-vis';
import * as d3 from 'd3';
import { Skeleton, Spinner } from '@chakra-ui/react';
import { dataPipes } from '../config/dataPipeEnum';
import {delay} from '../Util/delay';
interface XYResponseStruct {
	x: string;
	y: number;
}
interface XYResponseGraphData {
    graphData: XYResponseStruct[]
}
interface XYDataProps {
	graphdataStorage: XYResponseGraphData[];
	dataPipe: string[];
	socketConnection: any;
}

class BarChart extends React.Component<
	{ dataPipe: string[]; yAxisName: string },
	XYDataProps
> {
	constructor(props) {
		super(props);
		this.state = {
			graphdataStorage: [],
			dataPipe: this.props.dataPipe,
			socketConnection: SingletonSocket.getInstance().getSocket(),
		};
	}

	componentDidMount() {
        const {dataPipe, socketConnection, graphdataStorage} = this.state;
            socketConnection.on(dataPipe[0], (data) => {
                graphdataStorage.splice(0, 1, data)
				this.setState({ graphdataStorage: graphdataStorage});
            })
        socketConnection.on(dataPipe[1], (data) => {
                graphdataStorage.splice(1, 1, data)
				this.setState({ graphdataStorage: graphdataStorage});
        })
        socketConnection.on(dataPipe[2], (data) => {
                graphdataStorage.splice(2, 1, data)
				this.setState({ graphdataStorage: graphdataStorage});
        })
        socketConnection.on(dataPipe[3], (data) => {
                graphdataStorage.splice(3, 1, data)
				this.setState({ graphdataStorage: graphdataStorage});
        })
        socketConnection.on(dataPipe[4], (data) => {
                graphdataStorage.splice(4, 1, data)
				this.setState({ graphdataStorage: graphdataStorage});
        })

	}

	render() {
        const {graphdataStorage} = this.state;
		return (
			<div>
                {!graphdataStorage[0] || !graphdataStorage[1]|| graphdataStorage[2] || graphdataStorage[3] || graphdataStorage[4].graphData.length == 0 ? (
					<Skeleton height="500px"></Skeleton>
				) : (

					<XYPlot
						xType="time"
						width={750}
						height={500}
						animation={true}
						margin={{ bottom: 80, left: 50, right: 10, top: 20 }}
					>
						<XAxis tickLabelAngle={-45} tickTotal={10} />
                            <YAxis tickFormat={(tick) => d3.format('.2s')(tick)} />
                                <LineSeries
                                    curve={'curveMonotoneX'}
                                    data={graphdataStorage[0]}
                                    opacity={1}
                                    strokeStyle="solid"
                                    style={{}}
                            />
                            <LineSeries
                                    curve={'curveMonotoneX'}
                                    data={graphdataStorage[1]}
                                    opacity={1}
                                    strokeStyle="solid"
                                    style={{}}
                            />
                            <LineSeries
                                    curve={'curveMonotoneX'}
                                    data={graphdataStorage[2]}
                                    opacity={1}
                                    strokeStyle="solid"
                                    style={{}}
                            />
                            <LineSeries
                                    curve={'curveMonotoneX'}
                                    data={graphdataStorage[3]}
                                    opacity={1}
                                    strokeStyle="solid"
                                    style={{}}
                            />
                            <LineSeries
                                    curve={'curveMonotoneX'}
                                    data={graphdataStorage[4]}
                                    opacity={1}
                                    strokeStyle="solid"
                                    style={{}}
                                />

                            ))
                            }


					</XYPlot>
				)}
			</div>
		);
	}
}

export default BarChart;
